import photo1 from '../../assets/experience/freelance-web-developer.jpg';
import photo2 from '../../assets/experience/HVAC-engineer.jpeg';
import photo3 from '../../assets/experience/Mechanical-Engineering.jpg';
import photo4 from '../../assets/experience/Type of Water Distribution Network.jpg';
import { ExperienceContainer } from './experience.styles';

const Experience = () => {
  return (
     <ExperienceContainer>
        <img src={photo1} alt='freelance-web-developer.jpg' className="img"/>
        <img src={photo2} alt='HVAC-engineer.jpeg' className="img"/>
        <img src={photo3} alt='Mechanical-Engineering.jpg' className="img"/>
        <img src={photo4} alt='Type of Water Distribution Network.jpg' className="img"/>
        <div class='grid-container'>
        <main> main </main>
        <main> main </main>
        <section class="mom"> mom </section>
        <section class='yam'> yam </section>


    </div>
     </ExperienceContainer>


    );
  };


export default Experience;
